import React from "react";
import { Canvas } from "@react-three/fiber";
import { Sky } from "@react-three/drei";

export default function App(props:any) {
   return (
      <div>
        <Canvas>
          <Sky
             distance={450000}
             sunPosition={[5, 1, 8]}
             inclination={0}
             azimuth={0.25}
             {...props}
          />
        </Canvas>
      </div>

   );
}
